					["custom"] = "if not aura_env.isMythic or aura_env.isMythic and aura_env.state and aura_env.state.animate then\n    PlaySoundFile(\"Interface\\\\AddOns\\\\SharedMedia_Causese\\\\sound\\\\Add.ogg\", \"MASTER\")\nend",
