						["use_unit"] = true,
						["names"] = {
						},
						["custom"] = "function(allstates, event, unit, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID = ... \n        if subEvent == \"SPELL_AURA_APPLIED\" then\n            if aura_env.isMythic and (spellID == 307784 or spellID == 307785) then\n                if destGUID ~= WeakAuras.myGUID then \n                    aura_env.sides[destGUID] = spellID\n                else\n                    aura_env.mySide = spellID\n                end\n            elseif spellID == 307950 and destGUID ~= WeakAuras.myGUID then\n                local _, _, _, _, duration, expirationTime = WA_GetUnitDebuff(destName, spellID)\n                if aura_env.isMythic then\n                    if aura_env.sides[destGUID] == aura_env.mySide then\n                        allstates[destGUID] = {\n                            show = true,\n                            changed = true,\n                            progressType = \"timed\",\n                            duration = duration,\n                            expirationTime = expirationTime,\n                            name = \"Your Side\",\n                            animate = true,\n                            autoHide = true,\n                        }\n                    else\n                        allstates[destGUID] = {\n                            show = true,\n                            changed = true,\n                            progressType = \"timed\",\n                            duration = duration,\n                            expirationTime = expirationTime,\n                            name = \"Other Side\",\n                            autoHide = true,\n                        }\n                    end\n                else\n                    allstates[destGUID] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = duration,\n                        expirationTime = expirationTime,\n                        name = \"Add Inc\",\n                        autoHide = true,\n                    }\n                end\n            end\n        elseif subEvent == \"SPELL_AURA_REMOVED\" and spellID == 307950 and allstates[destGUID] then\n            allstates[destGUID].show = false\n            allstates[destGUID].changed = true\n        end\n    elseif event == \"ENCOUNTER_START\" then\n        local _, _, ID = GetInstanceInfo()\n        if ID == 16 then\n            aura_env.sides = {}\n            aura_env.isMythic = true\n        end\n    end\n    return true\nend",
