						["custom"] = "function(allstates, event, ...)\n    --using cleu for performance reasons, bosses have too many debuffs to iterate over\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timestamp, subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, _,_, auraType = ...\n        if (subEvent == \"SPELL_AURA_APPLIED\" \n            or subEvent == \"SPELL_AURA_APPLIED_DOSE\" \n        or subEvent == \"SPELL_AURA_REMOVED_DOSE\") \n        and spellID == 312328 then\n            local name, icon, count = WA_GetUnitAura(\"boss1\", spellID, aura_env.auraType[auraType])\n            if name then\n                allstates[destGUID] = {\n                    show = true,\n                    changed = true,\n                    --[[   progressType = \"timed\",\n                    duration = duration,\n                    expirationTime = expirationTime,]]\n                    icon = icon,\n                    stacks = count,\n                    autoHide = true,\n                }\n            end\n        end\n        if subEvent == \"SPELL_AURA_REMOVED\" and spellID == 312328 then\n            local state = allstates[destGUID]\n            if state then\n                state.show = false\n                state.changed = true\n            end\n        end\n    end\n    return true\nend",
