					["custom"] = "aura_env.keystone = nil\naura_env.keypost = function (force,guild, communityname)\n    for bag = 0, NUM_BAG_SLOTS do\n        local numSlots = GetContainerNumSlots(bag)\n        for slot = 1, numSlots do\n            if (GetContainerItemID(bag, slot) == 158923) then\n                local link = GetContainerItemLink(bag, slot)\n                if force or (aura_env.keystone and aura_env.keystone ~= link) then\n                    if guild then\n                        SendChatMessage(link, \"GUILD\")\n                    elseif communityname  then \n                        SendChatMessage(link, \"CHANNEL\", nil, communityname)\n                    else\n                        SendChatMessage(link, \"PARTY\")\n                    end                    \n                end\n                aura_env.keystone = link\n                return\n            end\n        end\n    end\nend",
