					["custom"] = "local TS = aura_env\nlocal region = WeakAuras.GetRegion(aura_env.id, aura_env.cloneId)\nregion.current = 0\n\nTS.frame= CreateFrame(\"BUTTON\", aura_env.state.name, region, \"SecureActionButtonTemplate\")\nTS.frame:SetAllPoints()\nTS.frame:RegisterForClicks(\"LeftButtonDown\",\"RightButtonDown\", \"MiddleButtonDown\")\n\nTS.frame:SetScript(\"Onclick\", function(self, button, down)        \n        if button == \"MiddleButton\" then\n            region.current = 0\n            return\n        end\n        \n        local menu = {\n            { text = \"Select:\", isTitle = true},\n        }\n        \n        for k,v in pairs(TS.creatures) do\n            menu[k] = {\n                text = v,\n                func = function() \n                    region.current = k\n                end,\n            }                \n        end\n        \n        local menuFrame = CreateFrame(\"Frame\", \"ExampleMenuFrame\", UIParent, \"UIDropDownMenuTemplate\")\n        menuFrame:SetPoint(\"CENTER\", UIParent, \"Center\")\n        menuFrame:Hide()\n        EasyMenu(menu, menuFrame, \"cursor\", 0 , 0, \"MENU\");\nend)\n\nTS.frame:SetScript(\"OnMouseWheel\", function(self, delta) \n        if not region.current then\n            region.current = 1\n            \n        else\n            region.current = (region.current + delta) % 8\n            if region.current <= 0 then\n                region.current = region.current + 8\n            end\n        end                \nend)\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
					["do_custom"] = true,
					["do_message"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.offsetWidth = 140\naura_env.offsetHeight = aura_env.offsetWidth\n\naura_env.shellQuests ={\n    [51625]=true,\n    [51626]=true,\n    [51627]=true,\n    [51628]=true,\n    [51629]=true,\n    [51630]=true,\n}\n\naura_env.IsInQuest = function()\n    local questLogCount = GetNumQuestLogEntries()\n    \n    for i = 1, questLogCount do\n        local _, _, _, _, _, _, _, questID  = GetQuestLogTitle(i)\n        if aura_env.shellQuests[questID] then\n            return true\n        end\n    end\nend\n\naura_env.creatures = {}\n\nfor i=1, 8 do\n    local r, g, b = aura_env.config[\"color\"..i][1], aura_env.config[\"color\"..i][2], aura_env.config[\"color\"..i][3]\n    aura_env.creatures[i] = WrapTextInColorCode(aura_env.config[\"name\"..i], string.sub(RGBToColorCode(r, g, b), 3))\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
