		["Smite and Atonement Count Helper"] = {
			["outline"] = "OUTLINE",
			["xOffset"] = 0,
			["displayText"] = "%c",
			["customText"] = "function ()\n    function GroupMembers(reversed, forceParty)\n        local unit  = (not forceParty and IsInRaid()) and 'raid' or 'party'\n        local numGroupMembers = (forceParty and GetNumSubgroupMembers()  or GetNumGroupMembers()) - (unit == \"party\" and 1 or 0)\n        local i = reversed and numGroupMembers or (unit == 'party' and 0 or 1)\n        return function()\n            local ret\n            if i == 0 and unit == 'party' then\n                ret = 'player'\n            elseif i <= numGroupMembers and i > 0 then\n                ret = unit .. i\n            end\n            i = i + (reversed and -1 or 1)\n            return ret\n        end\n    end\n    aura_env.rmBuffs = {\n        [194384] = true,\n    }\n    local buffCount, injuredCount = 0, 0\n    for unit in GroupMembers()  do\n        for i = 1, 40 do\n            local buff = select(10,UnitBuff(unit, i, nil, \"PLAYER\"))\n            if not buff then break end\n            if aura_env.rmBuffs[buff] then\n                buffCount = buffCount + 1\n                injuredCount = injuredCount + ((UnitHealth(unit) < UnitHealthMax(unit)) and 1 or 0)\n                break\n            end\n        end\n    end\n    return injuredCount ..\"/\".. buffCount\nend",
