						["custom"] = "function(event,_,event,_,sourceGUID,_,_,_,destGUID,_,_,_,spellid)\n    local time = GetTime()\n    local playerGUID = UnitGUID(\"player\")\n    local r = aura_env.region\n    --if r then\n    if event == \"UNIT_DIED\" or event == \"UNIT_DESTROYED\" or event == \"SPELL_INSTAKILL\" then --Unit Died, remove them from the target list.\n        aura_env.spiritsData[destGUID] = nil\n        aura_env.asPower = aura_env.getPowerFromAS()\n        r.text3:SetText(aura_env.powerTextUpdate())\n    elseif sourceGUID == playerGUID and event == \"SPELL_CAST_SUCCESS\" and spellid == 147193 then --Shadowy Apparition Spawned\n        if not aura_env.spiritsData[destGUID] then\n            aura_env.spiritsData[destGUID] = {}\n            aura_env.spiritsData[destGUID].count = 0\n        end\n        aura_env.spiritsData[destGUID].count = aura_env.spiritsData[destGUID].count + 1\n        aura_env.spiritsData[destGUID].lastUpdate = time\n        aura_env.asPower = aura_env.getPowerFromAS()\n        r.text3:SetText(aura_env.powerTextUpdate())\n    elseif sourceGUID == playerGUID and event == \"SPELL_DAMAGE\" and spellid == 148859 then --Auspicious Spirit Hit\n        if aura_env.spiritsData[destGUID] and aura_env.spiritsData[destGUID].count then\n            aura_env.spiritsData[destGUID].count = aura_env.spiritsData[destGUID].count - 1\n            aura_env.spiritsData[destGUID].lastUpdate = time\n            if aura_env.spiritsData[destGUID].count <= 0 then\n                aura_env.spiritsData[destGUID] = nil\n            end\n        end\n        aura_env.asPower = aura_env.getPowerFromAS()\n        r.text3:SetText(aura_env.powerTextUpdate())\n    end\n    --end\nend\n\n\n\n\n\n\n\n",
