						["custom"] = "function(allstates, e, u,...)\n    if e == \"INSTANCE_ENCOUNTER_ENGAGE_UNIT\" then\n        for _, state in pairs(allstates) do\n            state.show = false;\n            state.changed = true;\n        end\n        if not allstates[\"energy\"] then\n            for i = 1,5 do\n                local unit = \"boss\"..i\n                local guid = UnitGUID(unit)\n                if guid and aura_env.guids[select(6, strsplit(\"-\", guid))] then\n                    local current = UnitPower(unit)\n                    if current >= 80 then\n                        allstates[\"energy\"] = {\n                            show = true,\n                            changed = true,\n                            progressType = \"static\",\n                            energy = current,\n                        }\n                        break\n                    end\n                end\n            end\n        end\n    end\n    if e == \"UNIT_POWER_UPDATE\" then\n        local guid = UnitGUID(u)\n        if guid and aura_env.guids[select(6, strsplit(\"-\", guid))] then\n            local state = allstates[\"energy\"]\n            if state then\n                local current = UnitPower(u)\n                state.energy = current\n                state.changed = true\n                if current < 80 then\n                    state.show = false\n                    state.changed = true\n                end\n            end\n            if not state then\n                local current = UnitPower(u)\n                if current >= 80 then\n                    allstates[\"energy\"] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"static\",\n                        energy = current,\n                    }\n                end\n            end\n        end\n    end\n    return true\nend",
